  {name: "regular", counterno: "C1", ticketno: "A001"},
  {name: "senior citizen", counterno: "C1", ticketno: "A001"},
  {name: "pwd", counterno: "C1", ticketno: "A001"},	
  {name: "students", counterno:"C2", ticketno:"B002"},
]

